import React from 'react';
import { NavLink } from "react-router-dom";
import "../App.scss"



const Navigation = () => {
    return (
            <div class="navigation">
                <ul class="navigation__list">
                    <NavLink style={{ textDecoration: 'none' }} to="/"><li class="main__item"><span class="slash">/</span>Jay Pardel.</li></NavLink>
                    <NavLink style={{ textDecoration: 'none' }} to="/about"><li class="navigation__item">about</li></NavLink>
                    <NavLink style={{ textDecoration: 'none' }} to="/projects"><li class="navigation__item">projects</li></NavLink>
                    <NavLink style={{ textDecoration: 'none' }} to="/contact"><li class="navigation__item">contact</li></NavLink>
                </ul>
            </div>

    )
}

export default Navigation;
